import React from "react";
import { useSelector } from "react-redux";
import { useParams } from "react-router-dom";

const Diary = () => {
    const { id } = useParams();
    //해당 객체 가져옴
    const getData = useSelector((it) => it.write.writeList[id]);

    console.log(getData);
    console.log(id);

    return (
        <div className="Diary">
            <section>
                <h4>오늘의 감정</h4>
            </section>
        </div>
    );
};

export default Diary;
